import colorLogo from "../images/color-logo.png";
import whiteLogo from "../images/white-logo.png";

const Nav = ({ minimal }) => {
    return (
        <nav>
            <div className="logo-container">
                <img
                    className="logo"
                    src={minimal ? colorLogo : whiteLogo}
                    alt="logo"
                    width="200"
                    height="125"
                />
            </div>

            {!authToken && (<button className="primary-button">Create Account</button>)}
        </nav>
    );
};
export default Nav;
